import styled from 'styled-components';

const Container = styled.div``;

const BackDrop = styled.div`
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	z-index: 2;
	overflow: hidden;
	background-color: rgba(0, 0, 0, 0.4);
`;

const Content = styled.div``;

export { Container, Content, BackDrop };
